import getWeb3 from './getWeb3';

import registerMultipeTendors from './contracts/registerMultipleTendors.json';


const web3 = getWeb3();
const instance = new web3.eth.Contract(
  JSON.parse(registerMultipeTendors.interface),
  '  0xF82A808988E551aF6d8C26d523f9F5d75D05d992'
);

export default instance;
